import "./main-side.css"

const Sidebar = () =>{
	return (
		<div className="main-screen__sidebar">
			<div className="main-screen__sidebar-list">
				<a href="/profile">Profile</a>
				<a href="/dialogs ">Messages</a>
				<a href="#">News</a>
				<a href="#">Music</a>
				<a href="#">Settings</a>
			</div>
		</div>
	);
}
export default Sidebar;
